import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import '../styles/nav.css';
import guitar from '../img/guitar.svg';
import trebleClef from '../img/trebleClef.svg';
import { HouseDoor, MusicNoteBeamed, Table } from 'react-bootstrap-icons';
import symphonicStepsMainLogo from '../img/symphonicStepsMainLogo.png';

function TrebleClef() {
  return <img src={trebleClef} alt="Guitar" style={{ height: '24px', width: '24px' }} />;
}
function GuitarIcon() {
  return <img src={guitar} alt="Guitar" style={{ height: '24px', width: '24px' }} />;
}
function BsNav() {
  return (
    <Navbar expand="lg" className="bg-light" variant="light">
      <Container fluid>
        <Navbar.Brand href="/MainPage">
          <img
            alt="Symphonic Steps Logo"
            src={symphonicStepsMainLogo}
            className="navbar-logo"
          />
        </Navbar.Brand>

        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="/MainPage">
              <HouseDoor /> Home
            </Nav.Link>
            <Nav.Link href="/InstrumentSelector">
              <GuitarIcon /> Instrument Selector
            </Nav.Link>
            <Nav.Link href="/TheoryTrainer">
              <TrebleClef />
              Theory Trainer
            </Nav.Link>
            <Nav.Link href="/MusicVisualiser">
              <MusicNoteBeamed /> Music Visualiser
            </Nav.Link>           
            <Nav.Link href="/Datatable">
              <Table /> Data Table
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default BsNav;
